  return ( 
    <div className="rootlayout">
      <ScrollRestoration />
      <header>
        <nav>
          <img src={logo} alt="logo" width={"100"} height/>
          <NavLink to="/">Home</NavLink>

        </nav>
      </header>
      <main>
        <Outlet />
      </main>
    </div>
   );
}

export default RootLayout;
